import Topbar from "./components/topbar/Topbar";
import Login from "./pages/login/Login";

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <Router>
      <Topbar />
      <Switch>
      <Route path="/">
            <Home />
          </Route>
      </Switch>
    </Router>
  );
}

export default App;
